import React, { useEffect, useState } from 'react';
import axios from 'axios';
import CardItem from './CardItem';
import './Cards.css';

function Cards() {

    const[products, setProducts] =useState([]);

    useEffect(() => {
        axios.get(`http://localhost:8989/product/get/${5}`)
        .then(res => setProducts(res.data.modelData))
        .catch(error => console.log(error));
    },[]);
    //console.log(products);
    products.map((oneP,key)=>{
        console.log(oneP);
    })
    function setcard(){
        products.map((oneP,key))
        return(
            <CardItem 
                src={`http://localhost:8989/api/${oneP.productImage}`} 
                text={`${oneP.title}`}
                label='Adventure' 
                path='/servise' 
            />
        );
    }

    return (
        <div className='cards'>
            <h1> bla bla bla bla</h1>
            <div className='cards__container'>
                <div className='cards__wrapper'>
                    <ul className='cards__items'>
                        {
                            
                            products.map((oneP,key)=>(
                                <CardItem 
                                    src={`http://localhost:8989/api/${oneP.productImage}`} 
                                    text={`${oneP.title}`}
                                    label='Adventure' 
                                    path='/servise' 
                                />
                            ))
                        }
                        <CardItem 
                            src='images/img-9.jpg' 
                            text='Explore the hidden waterfall deep inside the amazon jungal' 
                            label='Adventure' 
                            path='/servise' 
                        />
                        <CardItem 
                            src='images/img-1.jpg' 
                            text='Explore the hidden waterfall deep inside the amazon jungal' 
                            label='Adventure' 
                            path='/servise' 
                        />
                        
                    </ul>
                    
                </div>    
            </div>            
        </div>
    );
}

export default Cards;
